/* eslint-env es6 */
/* eslint no-var: "error" */
/* eslint indent: ['error', 2] */

(() => {

    const sounds = [{
        name: '',
        title: '&lt;No sound&gt;',
        sound: null
    }, {
        name: 'idea',
        title: 'Idea',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'serviceBell',
        title: 'Service Bell',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'attention',
        title: 'Attention',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'notify',
        title: 'Notification',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'newsTing',
        title: 'News Ting',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'ping',
        title: 'Ping',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'reception',
        title: 'Reception',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'coin',
        title: 'Coin',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'bicycle',
        title: 'Bicycle',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'store',
        title: 'Store',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'message',
        title: 'Message',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'doorbell',
        title: 'Doorbell',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'alert',
        title: 'Alert',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'intercom',
        title: 'Intercom',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'chord',
        title: 'Chord',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'can',
        title: 'Can',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'tada',
        title: 'Tada',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'airhorn',
        title: 'Airhorn',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'bottle',
        title: 'Bottle',
        sound: 'data:audio/mpeg;base64,'
    }, {
        name: 'friend',
        title: 'Friend',
        sound: 'data:audio/mpeg;base64,'
    }];

    const silentPeriod = 5000; // 10 seconds
    // @TODO: add to settings
    let silentTimerID = null;
    let beSilent = false;
    sounds.sort((a, b) => a.title.localeCompare(b.title));
    //console.log(sounds);

    /**
     * Overwrite the open method of the XMLHttpRequest.prototype to intercept the server calls
     */
    (function (open) {
        XMLHttpRequest.prototype.open = function (method, url) {
            if (url == '/api/v1/vault/review') {
                if (method == 'GET') {
                    const start = new Date();
                    const intv = setInterval(() => {
                        const secs = ((new Date() - start) / 1000).toFixed(1);
                        let loader = document.querySelector('.wfrping_load_indicator');
                        if (!loader) {
                            const parent = document.querySelector('.wf-loader .wf-loader__animation');
                            if (parent) {
                                loader = document.createElement('div');
                                loader.classList.add('wfrping_load_indicator');
                                parent.appendChild(loader);
                                const infoLine = document.createElement('p');
                                infoLine.textContent = 'Loading next review...';
                                loader.appendChild(infoLine);
                                const counterLine = document.createElement('p');
                                loader.appendChild(counterLine);
                                const counter = document.createElement('span');
                                counter.classList.add('wfrping_load_counter');
                                counterLine.appendChild(counter);
                            }
                        }
                        if (loader) loader.querySelector('.wfrping_load_counter').textContent = ` ${secs}s`;
                    }, 100);
                    this.addEventListener('load', checkResponse(intv), false);
                }
                if (method == 'POST') {
                    beSilent = true;
                    clearTimeout(silentTimerID);  // for really fast reviewers ;-)
                    silentTimerID = window.setTimeout(()=>{beSilent = false;}, silentPeriod);
                }
            }
            open.apply(this, arguments);
        };
    })(XMLHttpRequest.prototype.open);

    const checkResponse = intv => function (e) {
        clearInterval(intv);
        try {
            const response = this.response;
            const json = JSON.parse(response);
            if (!json) return;
            if (json.captcha) return;
            if (!json.result) return;
            if (!beSilent) {
                playDing();
            }
            addSettings();
        } catch (e) {
            doReload();
            console.log(e); // eslint-disable-line no-console
        }
    }

    const playDing = () => {
        const sound = localStorage.hasOwnProperty("wfrping_sound") ? localStorage.wfrping_sound : null;
        if (sound && sounds.some(s => s.name === sound)) {
            const ding = new Audio(sounds.filter(s => s.name === sound)[0].sound);
            ding.play();
        }
    };

    const doReload = () => {
        const reload = localStorage.hasOwnProperty("wfrping_auto_reload") ? localStorage.wfrping_auto_reload : '0';
        if (reload == '1') {
            location.reload();
        }
    };

    const awaitElement = get => new Promise((resolve, reject) => {
        let triesLeft = 10;
        const queryLoop = () => {
            const ref = get();
            if (ref) resolve(ref);
            else if (!triesLeft) reject();
            else setTimeout(queryLoop, 100);
            triesLeft--;
        }
        queryLoop();
    });

    const insertAfter = (newNode, referenceNode) => {
        referenceNode.parentNode.insertBefore(newNode, referenceNode.nextSibling);
    };

    function addSettings() {
        awaitElement(
            () => document.querySelector("body > app-root > app-wayfarer > div > mat-sidenav-container > mat-sidenav-content > div > app-review > div.flex.justify-center.mt-8.ng-star-inserted")
        ).then(ref => {
            let settingsDiv = document.getElementById("wayfarerrtsettings");
            if (!settingsDiv) {
                settingsDiv = document.createElement('div');
                settingsDiv.id = "wayfarerrtsettings";
                settingsDiv.classList.add('wayfarerrh__visible');

                const settingsContainer = document.createElement('div');
                settingsContainer.setAttribute('class', 'wrap-collabsible')
                settingsContainer.id = "settingsContainer";

                const collapsibleInput = document.createElement("input");
                collapsibleInput.id = "collapsedSettings";
                collapsibleInput.setAttribute("class", "toggle");
                collapsibleInput.type = "checkbox";

                const collapsibleLabel = document.createElement("label");
                collapsibleLabel.setAttribute("class", "lbl-toggle-es");
                collapsibleLabel.innerText = "Add-on Settings";
                collapsibleLabel.setAttribute("for", "collapsedSettings");

                const collapsibleContent = document.createElement("div");
                collapsibleContent.setAttribute("class", "collapsible-content-es");

                collapsibleContent.appendChild(settingsDiv);
                settingsContainer.appendChild(collapsibleInput);
                settingsContainer.appendChild(collapsibleLabel);
                settingsContainer.appendChild(collapsibleContent);
                insertAfter(settingsContainer, ref);
            }

            let sound = localStorage.hasOwnProperty("wfrping_sound") ? localStorage.wfrping_sound : 'ding';

            let select = document.createElement('select');
            select.title = "Default Map View";
            select.innerHTML = sounds.map(item => `<option value="${item.name}" ${item.name == sound ? 'selected' : ''}>${item.title}</option>`).join('');
            select.addEventListener('change', function() {
                if (select.value === '') {
                    localStorage.removeItem('wfrping_sound');
                } else {
                    localStorage.wfrping_sound = select.value;
                }
                playDing();
            });
            select.id = 'wfrping_sound';
            select.classList.add('wfrping_select');

            const selectLabel = document.createElement('label');
            selectLabel.innerText = 'Available review sound: ';
            selectLabel.setAttribute('for', 'wfrping_sound');
            selectLabel.classList.add('wfrping_settings_label');

            let autoReloadInput = document.createElement('input');
            autoReloadInput.setAttribute("type", "checkbox");
            let autoReload = localStorage.wfrping_auto_reload;
            if (autoReload === undefined || autoReload === null || autoReload === "" || autoReload === "0") {
                autoReload = false;
            }
            autoReloadInput.checked = autoReload === "1";
            autoReloadInput.addEventListener('change', function() {
                autoReload = this.checked ? "1" : "0";
                localStorage['wfrping_auto_reload'] = autoReload;
            });
            autoReloadInput.id = "wfrping_auto_reload_input";
            autoReloadInput.classList.add('wfrping_input');

            const autoReloadLabel = document.createElement("label");
            autoReloadLabel.innerText = "Auto retry/reload on error:";
            autoReloadLabel.setAttribute("for", "wfrping_auto_reload_input");
            autoReloadLabel.classList.add('wfrping_settings_label');

            settingsDiv.appendChild(document.createElement('br'));
            settingsDiv.appendChild(selectLabel);
            settingsDiv.appendChild(select);
            settingsDiv.appendChild(document.createElement('br'));
            settingsDiv.appendChild(autoReloadLabel);
            settingsDiv.appendChild(autoReloadInput);
            settingsDiv.appendChild(document.createElement('br'));
        })
    };

    (() => {
        const css = `
            .wfrping_select {
                margin:  2px 12px;
                padding: 2px 12px;
                background-color: #FFFFFF;
                color: black;
            }

            .wfrping_input {
                margin:  2px 12px;
                padding: 2px 12px;
                width: 90px;
                background-color: #FFFFFF;
                color: black;
            }

            .wfrping_settings_label {
                margin:  2px 12px;
                padding: 2px 12px;
                color: black;
                font-size: 16px;
            }

            .wfrping_load_indicator {
                margin-top: 2em;
                text-align: center;
            }

            .wfrping_load_indicator p:first-child {
                margin-bottom: 1em;
            }

            .wfrping_load_indicator .wfrping_load_counter {
                display: inline-block;
                font-size: 1.5em;
                font-family: monospace;
            }

            .wrap-collabsible {
                margin: 1.2rem auto;
            }

            #collapsible,
            #collapsed-stats {
                display: none;
            }

            .lbl-toggle-es {
                display: block;
                font-weight: bold;
                font-family: monospace;
                font-size: 1.2rem;
                text-transform: uppercase;
                text-align: center;
                padding: 1rem;
                color: white;
                background: #DF471C;
                cursor: pointer;
                border-radius: 7px;
                transition: all 0.25s ease-out;
                width: 50%;
                margin: auto;
            }

            .lbl-toggle-es:hover {
                color: lightgrey;
            }

            .lbl-toggle-es::before {
                content: ' ';
                display: inline-block;
                border-top: 5px solid transparent;
                border-bottom: 5px solid transparent;
                border-left: 5px solid currentColor;
                vertical-align: middle;
                margin-right: .7rem;
                transform: translateY(-2px);
                transition: transform .2s ease-out;
            }

            .toggle {
                display:none;
            }

            .toggle:checked+.lbl-toggle-es::before {
                transform: rotate(90deg) translateX(-3px);
            }

            .collapsible-content-es {
                max-height: 0px;
                overflow: hidden;
                transition: max-height .25s ease-in-out;
                font-size: 16px;
                background-color: #e5e5e5;
                border: 1px;
                border-radius: 3px;
                border-style: double;
                border-color: #ff4713;
                margin: auto;
                width: 50%;
            }

            .toggle:checked+.lbl-toggle-es+.collapsible-content-es {
                max-height: 9999999pt;
            }

            .toggle:checked+.lbl-toggle-es {
                border-bottom-right-radius: 0;
                border-bottom-left-radius: 0;
            }

            .collapsible-content-es .content-inner {
                border-bottom: 1px solid rgba(0, 0, 0, 1);
                border-left: 1px solid rgba(0, 0, 0, 1);
                border-right: 1px solid rgba(0, 0, 0, 1);
                border-bottom-left-radius: 7px;
                border-bottom-right-radius: 7px;
                padding: .5rem 1rem;
            }
            `;
        const style = document.createElement('style');
        style.type = 'text/css';
        style.innerHTML = css;
        document.querySelector('head').appendChild(style);
    })();

})();
